import { login } from '../data';
// import { Post } from './Post';
import { Signup1 } from './Signup1'

export function Logins() {
	const LoginDivs = login.map((signup) => <Signup1 signup={signup} />);

	return (
		<div className='login' id=''>
			{LoginDivs}
		</div>
	);
}
